import { Component, OnInit } from '@angular/core';
import { DataService } from './services/data.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  //dataForm: FormGroup;dataService
  //persona:any;
  title:string = 'portfolio';

  /*constructor(
    //public dataService: DataService
    ){}*/


  /*ngOnInit(): void {*/
      //this.dataForm = this.fB.group({})
      /*this.dataService.getData().subscribe(resp=>{
        this.persona = resp;
        console.log(resp);
      },error=>{console.error(error)})*/
  /*}*/

  data:any;

  constructor(private dataService:DataService){}

  ngOnInit(): void {
    /*this.dataService.getData().subscribe(dataService => {
      this.data = dataService[0];
    });*/
    this.dataService.getData().subscribe({
      next: (resp) => {
        this.data = resp[0];
        console.log("AppComponent -> Datos Personales: "+JSON.stringify(this.data));
      },
      error: (error) => {
        console.error(error);
      }
    });
    console.log("DATA: "+this.data);
  }




}
